    [],nt"revision_timestamp": "2015-09-27T02:08:22.133234",nt"name": "scicex-submarine-arctic-science-program",nt"isopen":
    false,nt"url": null,nt"notes": "nThe Submarine Arctic Science Program,
    SCICEX, is a federal interagency collaboration among the operational Navy, research
    agencies, and the marine research community to use nuclear-powered submarines for
    scientific studies of the Arctic Ocean. Unlike surface ships, submarines have the
    unique ability to operate and take measurements regardless of sea ice cover, weather
    conditions, and time of year. This allows for a broad and comprehensive investigation
    of an entire ocean basin. The goal of the program is to acquire comprehensive data
    about Arctic sea ice, water properties (biological, chemical, and hydrographic),
    and water depth (bathymetry) to improve our understanding of the Arctic Ocean basin
    and its role in the Earth's climate system. SCICEX is important because it adds
    critical pieces to the overall information needed to analyze sea ice and ocean dynamics.
    Data collection began in 1993 and is on going.n",nt"license_title": null,nt"extras":
